import React , {Component} from 'react';
import {BrowserRouter,Route} from 'react-router-dom'
import MainPage from '../screens/MainPage/MainPage'
import ServicePage from '../screens/ServicePage/ServicePage'
import PersonsCount from '../screens/PersonsCount/PersonsCount'
import './App.scss';


class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Route path="/" exact component={MainPage}/>
        <Route path="/servicepage"  exact component={ServicePage}/>
        <Route path="/persons"  exact component={PersonsCount}/>

      </BrowserRouter>
    );
  }
}

export default App;
